import React from 'react';
import '../styles/table.css';

const AgentTable = ({ agents, onSortChange }) => {
  const renderHeader = (label, field) => (
    <th
      onClick={() => onSortChange(field)}
      style={{ cursor: 'pointer', userSelect: 'none' }}
    >
      {label} ‚¨ç
    </th>
  );

  return (
    <table>
      <thead>
        <tr>
          <th>Agent ID</th>
          {renderHeader('Name', 'agent_name')}
          {renderHeader('Status', 'status')}
          {renderHeader('Owner', 'owner')}
          {renderHeader('Type', 'agent_type')}
          {renderHeader('Framework', 'framework')}
          <th>Health</th>
          {renderHeader('Deployed At', 'deployed_at')}
        </tr>
      </thead>
      <tbody>
        {agents.map(agent => (
          <tr key={agent.agent_id}>
            <td>{agent.agent_id}</td>
            <td>{agent.agent_name}</td>
            <td>{agent.status}</td>
            <td>{agent.owner}</td>
            <td>{agent.agent_type}</td>
            <td>{agent.framework}</td>
            <td>{agent.health}</td>
            <td>{agent.deployed_at}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default AgentTable;
